import React from 'react';
import Link from 'next/link'
import { Button } from 'antd'

const Signup = () => {
    return (
    <>
        <div>회원가입</div>
        <Link href="/"><Button>홈</Button></Link>
        <Link href="/profile"><Button>프로필</Button></Link>
    </>)
}

export default Signup;
